import React from 'react'
import NSInput from '../components/NSInput'

export default {
  title: 'New Story Input',
  component: NSInput
}

export function NSInputContainer() {

  return (
    <div>
      <h3> A New Story form input field</h3>
        <NSInput />
    </div>
  )
}
